import React from 'react';
import Navbar from '../../components/Navbar'; // Adjusted to match App.js structure
import Footer from '../../components/Footer'; // Assuming Footer exists here
import '../../styles/Service.css'; // CSS file needs to be created

const Services = () => {
    const services = [
        {
            name: 'Haircut & Styling',
            description: 'Experience the latest trends in haircuts and styles.',
            image: 'https://images.unsplash.com/photo-1559599101-f09722fb4948?q=80&w=2669&auto=format&fit=crop',
        },
        {
            name: 'Massage Therapy',
            description: 'Relax with our soothing massage services.',
            image: 'https://images.unsplash.com/photo-1542848284-8afa78a08ccb?q=80&w=2572&auto=format&fit=crop',
        },
        {
            name: 'Manicure & Pedicure',
            description: 'Keep your nails stunning with our services.',
            image: 'https://images.unsplash.com/photo-1618328769009-b1a3e561f5e8?q=80&w=2670&auto=format&fit=crop',
        },
    ];

    return (
        <div className="services-page">
            <Navbar />
            <div className="services-header">
                <h1>Our Services</h1>
                <p>Explore our premium services.</p>
            </div>
            <div className="services-list">
                {services.map((service, index) => (
                    <div key={index} className="service-item">
                        <img src={service.image} alt={service.name} className="service-image" />
                        <h3>{service.name}</h3>
                        <p>{service.description}</p>
                        <button className="book-now-btn">Book Now</button>
                    </div>
                ))}
            </div>
            <Footer />
        </div>
    );
};

export default Services;
